function Future() {

    return (
        <>
            <div className='body-bg' >
                <Container className='cccontain' fluid="md" >

                    <Row className='rrrow-1'>

                        <Col><p>Hello

                        </p>
                            <h1>ok</h1>
                        </Col>

                        <Row>
                            <Col sm={4}>
                                <Col><h1>Multi Chain Deshboard tool</h1></Col>
                            </Col>
                            <Col sm={8}>
                                <img src={Group} alt='kd' />
                            </Col>
                        </Row>

                    </Row>



                </Container>
            </div >
        </>
    );
}

export default Future;
